import React from 'react';
import ReactDOM from 'react-dom';
import Rainbow from '../hoc/Rainbow';
import './Watches.css';
import Badge from '@material-ui/core/Badge';
import { withStyles } from '@material-ui/core/styles';
import IconButton from '@material-ui/core/IconButton';
import ShoppingCartIcon from '@material-ui/icons/ShoppingCart';

function shoot() {
	alert("Sepete Eklediniz...");
  }
  const myelement = (
	<button onClick={shoot}>SEPETE EKLE</button>
  );

const StyledBadge = withStyles((theme) => ({
	badge: {
	  right: -3,
	  top: 13,
	  border: `2px solid ${theme.palette.background.paper}`,
	  padding: '0 4px',
	},
  }))(Badge);



const Watches = (props) => {
	// console.log(props);
	// setTimeout(() => {
	// 	  props.history.push("/about");
	// 	}, 2000);

	return (
		<div>
			<div className="container">
				
                <div className='sss'><img src={require("./images/1s.jpg")}></img>
				<div id='wat1' className="ui vertical animated button" tabindex="0">
                <div className="hidden content">Shop</div>
                <div className="visible content">
                    <i className="shop icon"></i>
                    <a class="ui teal tag label">2.500$</a>
                </div>
                </div></div>
                <div className='sss'><img src={require("./images/2s.jpg")}></img>
				<div id='wat2' className="ui vertical animated button" tabindex="0">
                <div className="hidden content">Shop</div>
                <div className="visible content">
                    <i className="shop icon"></i>
                    <a class="ui teal tag label">1.090,99$</a>
                </div>
                </div></div>
                <div className='sss'><img src={require("./images/3s.jpg")}></img>
				<div id='wat3' className="ui vertical animated button" tabindex="0">
                <div className="hidden content">Shop</div>
                <div className="visible content">
                    <i className="shop icon"></i>
                    <a class="ui teal tag label">3.000$</a>
                </div>
                </div></div>
                <div className='sss'><img src={require("./images/4s.jpg")}></img>
				<a  id='w4'class="ui red ribbon label">İNDİRİM/1.500$</a>
				<div  onClick={shoot} id='wat4' className="ui vertical animated button" tabindex="0">
                <div className="hidden content">Shop</div>
                <div className="visible content">
                    <i className="shop icon"></i>
                    <a class="ui teal tag label">3.500$</a>
                </div>
                </div></div>
                <div className='sss'><img src={require("./images/5s.jpg")}></img>
				<div id='wat5' className="ui vertical animated button" tabindex="0">
                <div className="hidden content">Shop</div>
                <div className="visible content">
                    <i className="shop icon"></i>
                    <a class="ui teal tag label">4.445$</a>
                </div>
                </div></div>
				
                <div className='a'><button onClick={shoot} className="btn grey">
						Sepete Ekle
					</button>
										<IconButton aria-label="cart">
					<StyledBadge badgeContent={4} color="secondary">
						<ShoppingCartIcon />
					</StyledBadge>
					</IconButton>
					</div>
				
			</div>
            
		</div>
	)
}


export default Rainbow(Watches);
